import {Listaclienti} from '../../actions/authAutentications';
import React, { Component } from 'react';

import PropTypes from 'prop-types';
import { connect } from 'react-redux';

//componenti da react-bootstrap
import { Container, Col, Row } from 'react-bootstrap';

import ricercaFiltro from '../../utils/ricercaFiltro';

class AggiornaClienti extends Component {
  state = {
    searchFilter: ""
  };


  handleChange = (name, value) => {
    this.setState({ [name]: value});
  };
  
 async componentDidMount() {
   await this.props.Listaclienti();
 }

viewCustomer(id){
console.log(id);

}
 
  render() {
  const {
    searchFilter
  } = this.state;

  let utentiFiltrati = [];

  

   const {user}=this.props.customerlist;
   utentiFiltrati = ricercaFiltro(user, searchFilter, "name");
   const CL=(
<div className="container">
<div class="center">
 <table class="responsive-table">

 <thead>

<tr>

<th >Name</th>
<th >cognome</th>
<th >Email</th>

</tr>

 </thead>
 <tbody>
   {
    utentiFiltrati.map((user)=>
    <tr key={user._id}>
      <td>{user.name}</td>
      <td>{user.cognome}</td>
      <td>{user.email}</td>
    </tr>
    
    )}

   
 </tbody>
 </table>
</div>
</div>

   )

    
	return(
    
    <Container style={{marginTop: '3rem', marginBottom: '3rem'}}>
      <div className="Form">
            <form onSubmit={ricercaFiltro}>
              <Row>
                <Col sm={2}>
              <div className="form-group">
              <label htmlFor="name">Nome</label>
                <input
                  onChange={(event) => this.handleChange("searchFilter", event.target.value)}
                  id="name"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="cognome">Cognome</label>
                <input

                  id="cognome"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="email">Email</label>
                <input

                  id="email"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="numero">Numero di telefono</label>
                <input

                  id="numero"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <label htmlFor="cf">Codice Fiscale</label>
                <input

                  id="cf"
                  type="text"
                />
              </div>
              </Col>
              <Col sm={2}>
              <div className="form-group">
              <button type="submit" value="Registrazione Log" className="btn btn-dark btn-lg btn-block">Cerca</button>
              </div>
              </Col>
             </Row>
            </form>
          </div>
          <div className="row">
    {
      user.length===0?'NO USERS or server is offline':CL
    }
    </div>
          </Container>

  );
  }
}

 
   



AggiornaClienti.propTypes = {
 Listaclienti:PropTypes.func.isRequired,

 auth:PropTypes.object.isRequired,
 errors:PropTypes.object.isRequired,
customerlist:PropTypes.object.isRequired,

};
const mapStateToProps = state => ({
  auth:state.auth,
  errors:state.errors,
  customerlist:state.customerlist
});
export default connect(mapStateToProps, 
 {Listaclienti})
  (AggiornaClienti);
